import React, { useState } from "react";
import {
  FaFacebook,
  FaInstagram,
  FaYoutube,
  FaWhatsapp,
  FaChevronDown,
  FaChevronUp,
} from "react-icons/fa";

const Footer = () => {
  const [openDropdown, setOpenDropdown] = useState(null);
  const toggleDropdown = (item) => {
    setOpenDropdown(openDropdown === item ? null : item);
  };

  const dropdownItems = {
    contact: [
      { icon: <FaWhatsapp />, text: "+1 (234) 567-8910" },
      { icon: null, text: "info@tropinord.com" },
      { icon: null, text: "Sales: sales@tropinord.com" },
    ],
    follow: [
      { icon: <FaFacebook />, text: "Facebook" },
      { icon: <FaInstagram />, text: "Instagram" },
      { icon: <FaYoutube />, text: "YouTube Channel" },
    ],
  };

  return (
    <footer className="bg-green-600 text-gold-300 pt-12 pb-8 px-4 md:px-8">
      <div className="max-w-7xl mx-auto">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8 mb-8">
          {/* Contact Us */}
          <div>
            <h3
              onClick={() => toggleDropdown("contact")}
              className="flex items-center justify-between text-lg font-semibold mb-4 cursor-pointer text-gold-400 hover:text-gold-200 transition"
            >
              Contact Us
              {openDropdown === "contact" ? (
                <FaChevronUp className="text-gold-400" />
              ) : (
                <FaChevronDown className="text-gold-400" />
              )}
            </h3>
            {openDropdown === "contact" && (
              <ul className="space-y-2">
                {dropdownItems.contact.map((item, index) => (
                  <li
                    key={index}
                    className="flex items-center gap-2 hover:text-gold-200 transition"
                  >
                    {item.icon && (
                      <span className="text-gold-400">{item.icon}</span>
                    )}
                    <span>{item.text}</span>
                  </li>
                ))}
              </ul>
            )}
          </div>

          {/* Follow Us */}
          <div>
            <h3
              onClick={() => toggleDropdown("follow")}
              className="flex items-center justify-between text-lg font-semibold mb-4 cursor-pointer text-gold-400 hover:text-gold-200 transition"
            >
              Follow Us
              {openDropdown === "follow" ? (
                <FaChevronUp className="text-gold-400" />
              ) : (
                <FaChevronDown className="text-gold-400" />
              )}
            </h3>
            {openDropdown === "follow" && (
              <ul className="space-y-2">
                {dropdownItems.follow.map((item, index) => (
                  <li
                    key={index}
                    className="flex items-center gap-2 hover:text-gold-200 transition"
                  >
                    <span className="text-gold-400">{item.icon}</span>
                    <span>{item.text}</span>
                  </li>
                ))}
              </ul>
            )}
          </div>

          {/* Quick Links */}
          <div>
            <h3 className="text-lg font-semibold mb-4 text-gold-400">
              Quick Links
            </h3>
            <ul className="space-y-2">
              <li className="hover:text-gold-200 transition">
                <a href="/support">Support Us</a>
              </li>
              <li className="hover:text-gold-200 transition">
                <a href="/suggestions">Product Suggestions</a>
              </li>
              <li className="hover:text-gold-200 transition">
                <a href="/testimonials">Testimonials</a>
              </li>
              <li className="hover:text-gold-200 transition">
                <a href="/privacy">Privacy Policy</a>
              </li>
            </ul>
          </div>

          {/* Newsletter */}
          <div>
            <h3 className="text-lg font-semibold mb-4 text-gold-400">
              Stay Updated
            </h3>
            <p className="mb-4">
              Subscribe to our newsletter for the latest updates
            </p>
            <div className="flex">
              <input
                type="email"
                placeholder="Your email"
                className="px-4 py-2 w-full rounded-l text-gray-800 focus:outline-none"
              />
              <button className="bg-gold-500 hover:bg-gold-600 text-green-800 font-medium px-4 py-2 rounded-r transition">
                Subscribe
              </button>
            </div>
          </div>
        </div>

        {/* Bottom Bar */}
        <div className="border-t border-gold-700 pt-6 flex flex-col md:flex-row justify-between items-center">
          <p className="text-gold-300 mb-4 md:mb-0">
            &copy; {new Date().getFullYear()} TropiNord. All rights reserved.
          </p>
          <div className="flex gap-6">
            <a href="#" className="hover:text-gold-200 transition">
              Terms of Service
            </a>
            <a href="#" className="hover:text-gold-200 transition">
              Shipping Policy
            </a>
            <a href="#" className="hover:text-gold-200 transition">
              Returns Policy
            </a>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
